import React from 'react'
import ReactDOM from 'react-dom'
import $ from 'jquery'
import Stories from './component/Storie'
import Header from './component/Header'
import Profile from './component/Profile'
import TextComponent from './component/TextComponents'
import Footer from './component/Footer'
import './App.css';
import './component/Storie.css'


export default props => {
  return(

    <div className="bg">
      <Header/>

      <Profile
        cursor="pointer"
        nome="BRUNO"
        bitcoin="1GsaVB7ypw8zkZz5KKL124GcKEi1ZfCZdD"
        text="As the old world fall behind, my spirit reaches wide..."
      />

      <TextComponent/>

      <Footer nome="BRUNO"/>
    </div>

    )
}

export function clicar(){
        ReactDOM.render(<Stories button="X" />,document.getElementById('root'))
      }

export function fechar(){
      ReactDOM.unmountComponentAtNode(<Stories button="X" />)}
